text_show:
Astaamaha
1) Walxaha dib u soo celinta: Warshadaha dhalada, taarikada garaafyada waxaa loo isticmaalaa in lagu soo saaro graphite crucibles, sida wakiilada ilaalinta ee birta, iyo lebenka kaarboon ee magnesia ee xuubka foornooyinka dhalada.
2) Qalabka wax-qabadka: Warshadaha korantada, graphite waxaa si ballaaran loo isticmaalaa sida electrodes, burushka, tuubooyinka kaarboonka, iyo dahaarka tuubooyinka telefishanka.
3) Xidho walxaha adkaysiga u leh iyo saliidaha: Qalab badan oo makaanik ah, taa
... 
a kuleylka, qalabka ilaalinta shucaaca, iwm.
1. isotropy wanaagsan, sifooyin ka madax banaan cabbirka, qaabka, iyo jihada muunad;
2. Qaab dhismeedka lebbiska ah, cufnaanta, iyo awoodda antioxidant xooggan;
3. Saliid aad u fiican;
4. Iska caabbinta wanaagsan ee daxalka kiimikada;
5. Dhaqdhaqaaqa kulaylka sare iyo waxqabadka xasiloonida kulaylka;
6. Awood farsamo oo ku filan iyo iska caabin saameyn leh;
7. Si fudud loo mashiin karo waxaana lagu farsamayn karaa qaabab joomatari oo kala duwan iyadoo
...
ayn oo xoog leh, awood u leh inay bixiso tilmaamo kala duwan iyo taargooyin garaafyo kala go'an.
2. Waxaan ku siin karnaa alaabta graphite ee naqshadeynta extrusion, habeynta gariirka, naqshadeynta, iyo isku-duubista istatic-ga ah haddii loo baahdo.
3. Marka loo eego shuruudaha farsamo ee kala duwan, alaabta graphite sida taarikada graphite ayaa lagu soo rogi karaa daaweynta caabbinta oksaydhka, daaweynta aan fiicnayn, iyo daaweynta xoojinta si loo hagaajiyo waxqabadkooda iyo noloshooda adeegga.
